import React from "react";
import {Card, Grid, GridColumn, CardContent, CardHeader, CardDescription} from "semantic-ui-react";

function asd() {
    alert("asd");
}

var up = document.getElementById('GFG_UP'); 
            var url = new URL("https://www.geeksforgeeks.org"); 
            up.innerHTML = url; 
            var down = document.getElementById('GFG_DOWN'); 
              
            function GFG_Fun() { 
                url.searchParams.set('param_1', 'val_1'); 
                down.innerHTML = url; 
            } 

function People( {data} ) {
    return (
        <>
            <h1>People</h1>
            <Grid columns={3}>
                {data.map((people,i) => {
                    return(
                        <GridColumn key={i}>
                            <Card>
                                <CardContent>
                                    <CardHeader>{people.name}</CardHeader>
                                    <CardDescription>
                                        <strong>Height</strong>
                                        <p>{people.height}</p>
                                        <strong>Mass</strong>
                                        <p>{people.mass}</p>
                                        <strong>Gender</strong>
                                        <p>{people.gender}</p>
                                    </CardDescription>
                                </CardContent>
                            </Card>
                        </GridColumn>
                    )
                })}
            </Grid>
            <div id="prev-next-div">
                 <a id ="prevButton" href="#" onClick={asd} className="next round">&#8249;</a>
                 <a id ="nextButton" href="#" onClick={asd} className="next round">&#8250;</a>
            </div>
            
        </>
    )
}
export default People;
